measurements.description:
Six flowers on six 0.5-cm inflorescences;

	sepals acuminate, burgundy, green tips and abaxial surface ;

	petals acuminate, porrect, burgundy, green tips and abaxial surface;


	lip cream, heavily overlaid burgundy blotches basal two-thirds, less on apical one-third;
	column light green overlaid burgundy, anther cap light green;

	substance impressively firm; texture matte; unusually long 5.0cm pedicel; fragrance light coconut, citrus component atypical,
	identity verified by SITF.
